import { Component } from '@angular/core';
import {Competitor} from 'src/app/models/Competitor';
import { ToastrService } from 'ngx-toastr';
import { DisciplinaService } from 'src/app/services/disciplina.service';
import { CompetitorService } from 'src/app/services/competitor.service';

@Component({
  selector: 'app-mostrar-competidor',
  templateUrl: './mostrar-competidor.component.html',
  styleUrls: ['./mostrar-competidor.component.css']
})
export class MostrarCompetidorComponent {
  listaCompetitor : Competitor[]=[];
  constructor(private toastr: ToastrService,
    private competitorService:CompetitorService,
    private disciplinaService:DisciplinaService){

  }
  ngOnInit(){
this.obtenerCompetidores();
  }
  obtenerCompetidores() {
    this.competitorService.getCompetitor().subscribe(
      response => {
        console.log(response);
        const data = response.data;
        if (Array.isArray(data)) {
          this.listaCompetitor = data;
          for (const iterator of this.listaCompetitor) {
            console.log(iterator.name);
          }
        } else {
          console.error('Los datos recibidos no son un array:', data);
        }
      },
      error => {
        console.log(error);
      }
    );
  }
  eliminarCompetidor(id: any) {
    this.competitorService.eliminarCompetitor(id).subscribe( response => {
      console.log(response);
        const data = response.data;
      console.log('El producto fue eliminado con exito');
        this.toastr.error('El producto fue eliminado con exito' ,'Producto Eliminado');
        this.obtenerCompetidores();

    }, error => {
      console.log(error);
    })
  }
  buscar(id:string):string{
    let disciplinaNombre: string = '';
    this.disciplinaService.getDisciplineByIdO(id).subscribe(
      response => {
        console.log(response);
        const data = response.data;
      disciplinaNombre= data.name;
      },
      error => {
        console.log(error);
      });
      return disciplinaNombre;
  }
}
<div class="container mt-5">
    <div class="row">
        <div class="col-lg-8 offset-lg-2">
            <div class="card">
                <div class="card-body text-center">
                    <span class="titulo">LISTADO DE COMPETIDORES</span>
                    <button class="btn btn-success float-end" routerLink="/saveCompetitor">NUEVO</button>
                    <table *ngIf="listaCompetitor.length > 0" class="table table-striped mt-3">
                        <thead>
                          <tr>
                            <th scope="col">Id</th>
                            <th scope="col">Nombre</th>
                            <th scope="col">Apellido</th>
                            <th scope="col">F_Nacimiento</th>
                            <th scope="col">Disciplina</th>
                            <th scope="col">Acciones</th>
                          </tr>
                        </thead>
                        <tbody>
                          <tr *ngFor="let competitor of listaCompetitor">
                            <td>{{ competitor.id }}</td>
                            <td>{{ competitor.name }}</td>
                            <td>{{ competitor.surName }}</td>
                            <td>{{ competitor.birthdate}}</td>
                            <td>{{"buscar()}}</td>
                            <td>
                                <i [routerLink]="['/updateCompetitor', competitor.id]" class="fas fa-edit text-primary"></i>
                                <i (click)="eliminarCompetidor(competitor.id)" class="fas fa-trash text-danger"></i>
                            </td>
                          </tr>
                        </tbody>
                      </table>
                      <h5 style="text-align: start; margin-top: 10px;" *ngIf="listaCompetitor.length == 0">No hay Competidores para mostrar</h5>
                </div>
            </div>
        </div>
    </div>
</div>
